import React from "react";
import DeleteIcon from "@mui/icons-material/Delete";

const Notee = (props) => {
  const RemoveE = () => {
    props.deleteItem();
  };
  return (
    <>
      <div className="note">
        <h1>{props.title}</h1>
        <br />
        <p>{props.content}</p>
        <button className="btn" onClick={RemoveE}>
          <DeleteIcon className="deleteIcon " />
        </button>
      </div>
    </>
  );
};

export default Notee;
